            animeResponses2018.add("{\"id\":42916,\"name\":\"Sword Art Online: Progressive Movie - Hoshi Naki Yoru no Aria\",\"russian\":\"Мастера Меча Онлайн: Прогрессив — Ария в беззвёздной ночи\",\"image\":{\"original\":\"/system/animes/original/42916.jpg?1641783200\",\"preview\":\"/system/animes/preview/42916.jpg?1641783200\",\"x96\":\"/system/animes/x96/42916.jpg?1641783200\",\"x48\":\"/system/animes/x48/42916.jpg?1641783200\"},\"url\":\"/animes/42916-sword-art-online-progressive-movie-hoshi-naki-yoru-no-aria\",\"kind\":\"movie\",\"score\":\"8.0\",\"status\":\"released\",\"episodes\":1,\"episodes_aired\":1,\"aired_on\":\"2021-10-30\",\"released_on\":null,\"rating\":\"pg_13\",\"english\":[\"Sword Art Online the Movie: Progressive - Aria of a Starless Night\"],\"japanese\":[\"劇場版 ソードアート・オンライン プログレッシブ 星なき夜のアリア\"],\"synonyms\":[\"Искусство Меча Онлайн: Прогрессив — Ария в беззвёздной ночи\",\"SAO Progressive Movie\",\"Aria in the Starless Night\",\"Hoshinaki Yoru no Aria\"],\"license_name_ru\":null,\"duration\":97,\"description\":\"[character=36828]Асуна Юки[/character] была лучшей ученицей, усердно готовилась к вступительным экзаменам в старшую школу, но это было до того, как она одолжила у брата игровую систему виртуальной реальности и оказалась в ловушке Sword Art Online вместе с десятью тысячами других напуганных игроков. Проходит время, и [character=36828]Асуна[/character] начинает бояться, что станет с её жизнью за пределами фантастического мира. Какой неудачницей она может оказаться в глазах сверстников и родителей. Не желая ждать в сторонке, пока более опытные игроки пройдут игру, [character=36828]Асуна[/character] использует свои способности к обучению, чтобы изучить механику игры и владение мечом. Её быстрота впечатляет [character=36765]Кирито[/character], профессионального геймера, который приглашает [character=36828]Асуну[/character] присоединиться к лучшим игрокам на передовой. Готова ли [character=36828]Асуна[/character] поменять рейтинг класса на рейтинг игрока и присоединиться к [character=36765]Кирито[/character]?\",\"description_html\":\"\\u003cdiv class=\\\"b-text_with_paragraphs\\\"\\u003e\\u003ca href=\\\"https://shikimori.one/characters/36828-asuna-yuuki\\\" title=\\\"Asuna Yuuki\\\" class=\\\"bubbled b-link\\\" data-tooltip_url=\\\"https://shikimori.one/characters/36828-asuna-yuuki/tooltip\\\" data-attrs=\\\"{\\u0026quot;id\\u0026quot;:36828,\\u0026quot;type\\u0026quot;:\\u0026quot;character\\u0026quot;,\\u0026quot;name\\u0026quot;:\\u0026quot;Asuna Yuuki\\u0026quot;,\\u0026quot;russian\\u0026quot;:\\u0026quot;Асуна Юки\\u0026quot;}\\\"\\u003eАсуна Юки\\u003c/a\\u003e была лучшей ученицей, усердно готовилась к вступительным экзаменам в старшую школу, но это было до того, как она одолжила у брата игровую систему виртуальной реальности и оказалась в ловушке Sword Art Online вместе с десятью тысячами других напуганных игроков. Проходит время, и \\u003ca href=\\\"https://shikimori.one/characters/36828-asuna-yuuki\\\" title=\\\"Asuna Yuuki\\\" class=\\\"bubbled b-link\\\" data-tooltip_url=\\\"https://shikimori.one/characters/36828-asuna-yuuki/tooltip\\\" data-attrs=\\\"{\\u0026quot;id\\u0026quot;:36828,\\u0026quot;type\\u0026quot;:\\u0026quot;character\\u0026quot;,\\u0026quot;name\\u0026quot;:\\u0026quot;Asuna Yuuki\\u0026quot;,\\u0026quot;russian\\u0026quot;:\\u0026quot;Асуна Юки\\u0026quot;}\\\"\\u003eАсуна\\u003c/a\\u003e начинает бояться, что станет с её жизнью за пределами фантастического мира. Какой неудачницей она может оказаться в глазах сверстников и родителей. Не желая ждать в сторонке, пока более опытные игроки пройдут игру, \\u003ca href=\\\"https://shikimori.one/characters/36828-asuna-yuuki\\\" title=\\\"Asuna Yuuki\\\" class=\\\"bubbled b-link\\\" data-tooltip_url=\\\"https://shikimori.one/characters/36828-asuna-yuuki/tooltip\\\" data-attrs=\\\"{\\u0026quot;id\\u0026quot;:36828,\\u0026quot;type\\u0026quot;:\\u0026quot;character\\u0026quot;,\\u0026quot;name\\u0026quot;:\\u0026quot;Asuna Yuuki\\u0026quot;,\\u0026quot;russian\\u0026quot;:\\u0026quot;Асуна Юки\\u0026quot;}\\\"\\u003eАсуна\\u003c/a\\u003e использует свои способности к обучению, чтобы изучить механику игры и владение мечом. Её быстрота впечатляет \\u003ca href=\\\"https://shikimori.one/characters/36765-kazuto-kirigaya\\\" title=\\\"Kazuto Kirigaya\\\" class=\\\"bubbled b-link\\\" data-tooltip_url=\\\"https://shikimori.one/characters/36765-kazuto-kirigaya/tooltip\\\" data-attrs=\\\"{\\u0026quot;id\\u0026quot;:36765,\\u0026quot;type\\u0026quot;:\\u0026quot;character\\u0026quot;,\\u0026quot;name\\u0026quot;:\\u0026quot;Kazuto Kirigaya\\u0026quot;,\\u0026quot;russian\\u0026quot;:\\u0026quot;Кадзуто Киригая\\u0026quot;}\\\"\\u003eКирито\\u003c/a\\u003e, профессионального геймера, который приглашает \\u003ca href=\\\"https://shikimori.one/characters/36828-asuna-yuuki\\\" title=\\\"Asuna Yuuki\\\" class=\\\"bubbled b-link\\\" data-tooltip_url=\\\"https://shikimori.one/characters/36828-asuna-yuuki/tooltip\\\" data-attrs=\\\"{\\u0026quot;id\\u0026quot;:36828,\\u0026quot;type\\u0026quot;:\\u0026quot;character\\u0026quot;,\\u0026quot;name\\u0026quot;:\\u0026quot;Asuna Yuuki\\u0026quot;,\\u0026quot;russian\\u0026quot;:\\u0026quot;Асуна Юки\\u0026quot;}\\\"\\u003eАсуну\\u003c/a\\u003e присоединиться к лучшим игрокам на передовой. Готова ли \\u003ca href=\\\"https://shikimori.one/characters/36828-asuna-yuuki\\\" title=\\\"Asuna Yuuki\\\" class=\\\"bubbled b-link\\\" data-tooltip_url=\\\"https://shikimori.one/characters/36828-asuna-yuuki/tooltip\\\" data-attrs=\\\"{\\u0026quot;id\\u0026quot;:36828,\\u0026quot;type\\u0026quot;:\\u0026quot;character\\u0026quot;,\\u0026quot;name\\u0026quot;:\\u0026quot;Asuna Yuuki\\u0026quot;,\\u0026quot;russian\\u0026quot;:\\u0026quot;Асуна Юки\\u0026quot;}\\\"\\u003eАсуна\\u003c/a\\u003e поменять рейтинг класса на рейтинг игрока и присоединиться к \\u003ca href=\\\"https://shikimori.one/characters/36765-kazuto-kirigaya\\\" title=\\\"Kazuto Kirigaya\\\" class=\\\"bubbled b-link