            animeResponses2018.add("{\"id\":36649,\"name\":\"Banana Fish\",\"russian\":\"Банановая рыба\",\"image\":{\"original\":\"/system/animes/original/36649.jpg?1634674225\",\"preview\":\"/system/animes/preview/36649.jpg?1634674225\",\"x96\":\"/system/animes/x96/36649.jpg?1634674225\",\"x48\":\"/system/animes/x48/36649.jpg?1634674225\"},\"url\":\"/animes/36649-banana-fish\",\"kind\":\"tv\",\"score\":\"8.51\",\"status\":\"released\",\"episodes\":24,\"episodes_aired\":24,\"aired_on\":\"2018-07-06\",\"released_on\":\"2018-12-21\",\"rating\":\"r\",\"english\":[null],\"japanese\":[\"BANANA FISH\"],\"synonyms\":[\"Рыбка-бананка\"],\"license_name_ru\":null,\"duration\":22,\"description\":\"Щедрая природа одарила [character=13580]Эша Линкса[/character] красотой, а воспитание превратило в жестокого и безжалостного убийцу. Бродяга, принятый в семью «Папы» Дино Гольцине в качестве наследника и секс-игрушки, он достигает возраста семнадцати лет и сбегает из дома, решив взбунтоваться против дьявола, который его вырастил. Но страшная тайна, из-за которой старший брат [character=13580]Эша[/character] сошёл с ума в Ираке, оказывается в лапах омерзительного, беспринципного Папы. Поэтому сейчас не самый удачный момент для [character=21928]Эйджи Окумуры[/character], молодого чистосердечного фотографа из Японии, заводить знакомство с погрязшим в бездне проблем [character=13580]Эшем[/character]...\",\"description_html\":\"\\u003cdiv class=\\\"b-text_with_paragraphs\\\"\\u003eЩедрая природа одарила \\u003ca href=\\\"https://shikimori.one/characters/13580-aslan-jade-callenreese\\\" title=\\\"Aslan Jade Callenreese\\\" class=\\\"bubbled b-link\\\" data-tooltip_url=\\\"https://shikimori.one/characters/13580-aslan-jade-callenreese/tooltip\\\" data-attrs=\\\"{\\u0026quot;id\\u0026quot;:13580,\\u0026quot;type\\u0026quot;:\\u0026quot;character\\u0026quot;,\\u0026quot;name\\u0026quot;:\\u0026quot;Aslan Jade Callenreese\\u0026quot;,\\u0026quot;russian\\u0026quot;:\\u0026quot;Эш Линкс\\u0026quot;}\\\"\\u003eЭша Линкса\\u003c/a\\u003e красотой, а воспитание превратило в жестокого и безжалостного убийцу. Бродяга, принятый в семью «Папы» \\u003ca href=\\\"https://shikimori.one/characters/159440-dino-golzine\\\" title=\\\"Dino Golzine\\\" class=\\\"bubbled b-link\\\" data-tooltip_url=\\\"https://shikimori.one/characters/159440-dino-golzine/tooltip\\\" data-attrs=\\\"{\\u0026quot;id\\u0026quot;:159440,\\u0026quot;type\\u0026quot;:\\u0026quot;character\\u0026quot;,\\u0026quot;name\\u0026quot;:\\u0026quot;Dino Golzine\\u0026quot;,\\u0026quot;russian\\u0026quot;:\\u0026quot;Дино Гольцине\\u0026quot;}\\\"\\u003eДино Гольцине\\u003c/a\\u003e в качестве наследника и секс-игрушки, он достигает возраста семнадцати лет и сбегает из дома, решив взбунтоваться против дьявола, который его вырастил. Но страшная тайна, из-за которой старший брат \\u003ca href=\\\"https://shikimori.one/characters/13580-aslan-jade-callenreese\\\" title=\\\"Aslan Jade Callenreese\\\" class=\\\"bubbled b-link\\\" data-tooltip_url=\\\"https://shikimori.one/characters/13580-aslan-jade-callenreese/tooltip\\\" data-attrs=\\\"{\\u0026quot;id\\u0026quot;:13580,\\u0026quot;type\\u0026quot;:\\u0026quot;character\\u0026quot;,\\u0026quot;name\\u0026quot;:\\u0026quot;Aslan Jade Callenreese\\u0026quot;,\\u0026quot;russian\\u0026quot;:\\u0026quot;Эш Линкс\\u0026quot;}\\\"\\u003eЭша\\u003c/a\\u003e сошёл с ума в Ираке, оказывается в лапах омерзительного, беспринципного Папы. Поэтому сейчас не самый удачный момент для \\u003ca href=\\\"https://shikimori.one/characters/21928-eiji-okumura\\\" title=\\\"Eiji Okumura\\\" class=\\\"bubbled b-link\\\" data-tooltip_url=\\\"https://shikimori.one/characters/21928-eiji-okumura/tooltip\\\" data-attrs=\\\"{\\u0026quot;id\\u0026quot;:21928,\\u0026quot;type\\u0026quot;:\\u0026quot;character\\u0026quot;,\\u0026quot;name\\u0026quot;:\\u0026quot;Eiji Okumura\\u0026quot;,\\u0026quot;russian\\u0026quot;:\\u0026quot;Эйджи Окумура\\u0026quot;}\\\"\\u003eЭйджи Окумуры\\u003c/a\\u