            animeResponses2018.add("{\"id\":41457,\"name\":\"86\",\"russian\":\"Восемьдесят шесть\",\"image\":{\"original\":\"/system/animes/original/41457.jpg?1639395720\",\"preview\":\"/system/animes/preview/41457.jpg?1639395720\",\"x96\":\"/system/animes/x96/41457.jpg?1639395720\",\"x48\":\"/system/animes/x48/41457.jpg?1639395720\"},\"url\":\"/animes/41457-86\",\"kind\":\"tv\",\"score\":\"8.2\",\"status\":\"released\",\"episodes\":11,\"episodes_aired\":11,\"aired_on\":\"2021-04-11\",\"released_on\":\"2021-06-20\",\"rating\":\"r\",\"english\":[null],\"japanese\":[\"86―エイティシックス―\"],\"synonyms\":[\"Eighty Six\"],\"license_name_ru\":\"86 ВОСЕМЬДЕСЯТ ШЕСТЬ\",\"duration\":23,\"description\":\"Долгое время Республика Сан-Магнолия находится в военном конфликте с Империей, соседним государством, которое создало серию беспилотных военных машин. В ответ на угрозу республика успешно завершает разработку аналогичной технологии и отражает атаку противника, сумев обойтись без жертв. Однако это... официальная версия. На самом деле жертвы были. За пределами известных восьмидесяти пяти районов республики фактически был ещё один, «несуществующий» 86-й округ. Именно там днём и ночью шли бои, в которых принимали участие члены отряда «Восемьдесят шесть», управляя беспилотниками.\\r\\nВстаёт закономерный вопрос: сможет ли государственный строй, при котором правительство беспокоится только о личной выгоде, привести государство к процветанию? Ждёт ли счастье участников военных действий, что с той, что с другой стороны, которые каждый день рискуют жизнями и теряют друзей и близких? Безнаказанны ли останутся те, кто находится далеко от поля битвы, где им не угрожает опасность, благодаря чему они начинают думать, что война не так уж и страшна, а даже забавна.\",\"description_html\":\"\\u003cdiv class=\\\"b-text_with_paragraphs\\\"\\u003eДолгое время Республика Сан-Магнолия находится в военном конфликте с Империей, соседним государством, которое создало серию беспилотных военных машин. В ответ на угрозу республика успешно завершает разработку аналогичной технологии и отражает атаку противника, сумев обойтись без жертв. Однако это... официальная версия. На самом деле жертвы были. За пределами известных восьмидесяти пяти районов республики фактически был ещё один, «несуществующий» 86-й округ. Именно там днём и ночью шли бои, в которых принимали участие члены отряда «Восемьдесят шесть», управляя беспилотниками.\\u003cbr\\u003eВстаёт закономерный вопрос: сможет ли государственный строй, при котором правительство беспокоится только о личной выгоде, привести государство к процветанию? Ждёт ли счастье участников военных действий, что с той, что с другой стороны, которые каждый день рискуют жизнями и теряют друзей и близких? Безнаказанны ли останутся те, кто находится далеко от поля битвы, где им не угрожает опасность, благодаря чему они начинают думать, что война не так уж и страшна, а даже забавна.\\u003c/div\\u003e\",\"description_source\":null,\"franchise\":\"86_part\",\"favoured\":false,\"anons\":false,\"ongoing\":false,\"thread_id\":304990,\"topic_id\":304990,\"myanimelist_id\":41457,\"rates_scores_stats\":[{\"name\":10,\"value\":4051},{\"name\":9,\"value\":3757},{\"name\":8,\"value\":4740},{\"name\":7,\"value\":2691},{\"name\":6,\"value\":1066},{\"name\":5,\"value\":477},{\"name\":4,\"value\":250},{\"name\":3,\"value\":76},{\"name\":2,\"value\":61},{\"name\":1,\"value\":87}],\"rates_statuses_stats\":[{\"name\":\"Запланировано\",\"value\":19148},{\"name\":\"Просмотрено\",\"value\":25797},{\"name\":\"Смотрю\",\"value\":2896},{\"name\":\"Брошено\",\"value\":1370},{\"name\":\"Отложено\",\"value\":796}],\"updated_at\":\"2022-10-22T22:35:56.227+03:00\",\"next_episode_at\":null,\"fansubbers\":[\"Crunchyroll\",\"MontralfiveStudio\",\"YRsub\",\"SovetRomantica\",\"MedusaSub\",\"AniLibria\"],\"fandubbers\":[\"AniStar\",\"AniLibria\",\"Amazing Dubbing\",\"AniFilm\",\"SHIZA Project\",\"AniDUB\",\"AnimeVost\",\"FRONDA\",\"AniPlague\",\"Sergei Vasya \\u0026 Mamzelka\"