            animeResponses2018.add("{\"id\":40417,\"name\":\"Fruits Basket 2nd Season\",\"russian\":\"Корзинка фруктов 2\",\"image\":{\"original\":\"/system/animes/original/40417.jpg?1644224851\",\"preview\":\"/system/animes/preview/40417.jpg?1644224851\",\"x96\":\"/system/animes/x96/40417.jpg?1644224851\",\"x48\":\"/system/animes/x48/40417.jpg?1644224851\"},\"url\":\"/animes/40417-fruits-basket-2nd-season\",\"kind\":\"tv\",\"score\":\"8.57\",\"status\":\"released\",\"episodes\":25,\"episodes_aired\":25,\"aired_on\":\"2020-04-07\",\"released_on\":\"2020-09-22\",\"rating\":\"pg_13\",\"english\":[null],\"japanese\":[\"フルーツバスケット 2nd season\"],\"synonyms\":[\"Fruits Basket (2019) 2nd Season\",\"Furuba\",\"Fruits Basket (Zenpen)\"],\"license_name_ru\":\"Корзинка фруктов 2\",\"duration\":23,\"description\":\"Прошёл год с того момента, как Тору Хонда [本田 透] поселилась в доме семьи Сома. За это время она укрепила отношения с живущими в нём Сигурэ [草摩 紫呉], Кё [草摩 夾] и Юки [草摩 由希]. Кроме того, она сблизилась с другими членами семьи и, помогая им с множеством личных проблем, узнала об их родовой тайне. Однако чем больше узнаёт Тору, тем лучше понимает, что этот секрет скрывает правду намного темнее, чем она предполагала сначала.\\n\\nПриближается лето, и Хонду приглашают провести его вместе с Сома, по большей части с Кё и Юки. Тору надеется на спокойные каникулы, однако её близкие отношения с двумя парнями и остальными членами их семьи могут оказаться причиной неприятностей. По мере того, как они становятся ближе, их совместному беззаботному времяпровождению препятствуют старые трудности и чувства из прошлого, начинающие всплывать на поверхность.\\n\\nТрадиционный Банкет не за горами, и все члены «зодиака» должны выполнять свои обязанности бок о бок с нервным главой семьи, Акито [草摩 慊人]. С приближением Банкета и избытком чувств, в которых нужно разобраться, останется ли жизнь Тору с семьёй Сома такой же мирной, или же она окажется в ситуации, из которой выхода нет?\",\"description_html\":\"\\u003cdiv class=\\\"b-text_with_paragraphs\\\"\\u003eПрошёл год с того момента, как \\u003ca href=\\\"https://shikimori.one/characters/207-tooru-honda\\\" title=\\\"Tooru Honda\\\" class=\\\"bubbled b-link\\\" data-tooltip_url=\\\"https://shikimori.one/characters/207-tooru-honda/tooltip\\\" data-attrs=\\\"{\\u0026quot;id\\u0026quot;:207,\\u0026quot;type\\u0026quot;:\\u0026quot;character\\u0026quot;,\\u0026quot;name\\u0026quot;:\\u0026quot;Tooru Honda\\u0026quot;,\\u0026quot;russian\\u0026quot;:\\u0026quot;Тору Хонда\\u0026quot;}\\\"\\u003eТору Хонда\\u003c/a\\u003e поселилась в доме семьи Сома. За это время она укрепила отношения с живущими в нём \\u003ca href=\\\"https://shikimori.one/characters/206-shigure-souma\\\" title=\\\"Shigure Souma\\\" class=\\\"bubbled b-link\\\" data-tooltip_url=\\\"https://shikimori.one/characters/206-shigure-souma/tooltip\\\" data-attrs=\\\"{\\u0026quot;id\\u0026quot;:206,\\u0026quot;type\\u0026quot;:\\u0026quot;character\\u0026quot;,\\u0026quot;name\\u0026quot;:\\u0026quot;Shigure Souma\\u0026quot;,\\u0026quot;russian\\u0026quot;:\\u0026quot;Сигурэ Сома\\u0026quot;}\\\"\\u003eСигурэ\\u003c/a\\u003e, \\u003ca href=\\\"https://shikimori.one/characters/209-kyou-souma\\\" title=\\\"Kyou Souma\\\" class=\\\"bubbled b-link\\\" data-tooltip_url=\\\"https://shikimori.one/characters/209-kyou-souma/tooltip\\\" data-attrs=\\\"{\\u0026quot;id\\u0026quot;:209,\\u0026quot;type\\u0026quot;:\\u0026quot;character\\u0026quot;,\\u0026quot;name\\u0026quot;:\\u0026quot;Kyou Souma\\u0026quot;,\\u0026quot;russian\\u0026quot;:\\u0026quot;Кё Сома\\u0026quot;}\\\"\\u003eКё\\u003c/a\\u003e и \\u003ca href=\\\"https://shikimori.one/characters/208-yuki-souma\\\" title=\\\"Yuki Souma\\\" class=\\\"bubbled b-link\\\" data-tooltip_url=\\\"https://shikimori.one/characters/208-yuki-souma/tooltip\\\" data-attrs=\\\"{\\u0026quot;id\\u0026quot;:208,\\u0026quot;type\\u0026quot;:\\u0026quot;character\\u0026quot;,\\u0026quot;name\\u0026quot;:\\u0026quot;Yuki 