=\\\"https://shikimori.one/characters/207-tooru-honda\\\" title=\\\"Tooru Honda\\\" class=\\\"bubbled b-link\\\" data-tooltip_url=\\\"https://shikimori.one/characters/207-tooru-honda/tooltip\\\" data-attrs=\\\"{\\u0026quot;id\\u0026quot;:207,\\u0026quot;type\\u0026quot;:\\u0026quot;character\\u0026quot;,\\u0026quot;name\\u0026quot;:\\u0026quot;Tooru Honda\\u0026quot;,\\u0026quot;russian\\u0026quot;:\\u0026quot;Тору Хонда\\u0026quot;}\\\"\\u003eТору\\u003c/a\\u003e с семьёй Сома такой же мирной, или же она окажется в ситуации, из которой выхода нет?\\u003c/div\\u003e\",\"description_source\":null,\"franchise\":\"fruits_basket\",\"favoured\":false,\"anons\":false,\"ongoing\":false,\"thread_id\":293133,\"topic_id\":293133,\"myanimelist_id\":40417,\"rates_scores_stats\":[{\"name\":10,\"value\":1539},{\"name\":9,\"value\":1078},{\"name\":8,\"value\":1297},{\"name\":7,\"value\":687},{\"name\":6,\"value\":290},{\"name\":5,\"value\":129},{\"name\":4,\"value\":59},{\"name\":3,\"value\":15},{\"name\":2,\"value\":11},{\"name\":1,\"value\":20}],\"rates_statuses_stats\":[{\"name\":\"Запланировано\",\"value\":8595},{\"name\":\"Просмотрено\",\"value\":9881},{\"name\":\"Смотрю\",\"value\":1302},{\"name\":\"Брошено\",\"value\":500},{\"name\":\"Отложено\",\"value\":455}],\"updated_at\":\"2022-10-22T08:01:40.790+03:00\",\"next_episode_at\":null,\"fansubbers\":[\"Wakanim\",\"YakuSub Studio\"],\"fandubbers\":[\"KANSAI Studio\",\"SHIZA Project\",\"AniStar\",\"Wakanim\",\"AniLibria\",\"Amazing Dubbing\",\"AniMaunt\",\"AnimeVost\",\"Jisedai\",\"Indie Dub\",\"AniDUB\"],\"licensors\":[\"Wakanim\",\"Crunchyroll\"],\"genres\":[{\"id\":25,\"name\":\"Shoujo\",\"russian\":\"Сёдзё\",\"kind\":\"anime\"},{\"id\":4,\"name\":\"Comedy\",\"russian\":\"Комедия\",\"kind\":\"anime\"},{\"id\":8,\"name\":\"Drama\",\"russian\":\"Драма\",\"kind\":\"anime\"},{\"id\":22,\"name\":\"Romance\",\"russian\":\"Романтика\",\"kind\":\"anime\"},{\"id\":36,\"name\":\"Slice of Life\",\"russian\":\"Повседневность\",\"kind\"