            animeResponses2018.add("{\"id\":39565,\"name\":\"Boku no Hero Academia the Movie 2: Heroes:Rising\",\"russian\":\"Моя геройская академия: Восхождение героев\",\"image\":{\"original\":\"/system/animes/original/39565.jpg?1660915077\",\"preview\":\"/system/animes/preview/39565.jpg?1660915077\",\"x96\":\"/system/animes/x96/39565.jpg?1660915077\",\"x48\":\"/system/animes/x48/39565.jpg?1660915077\"},\"url\":\"/animes/39565-boku-no-hero-academia-the-movie-2-heroes-rising\",\"kind\":\"movie\",\"score\":\"8.01\",\"status\":\"released\",\"episodes\":1,\"episodes_aired\":0,\"aired_on\":\"2019-12-20\",\"released_on\":null,\"rating\":\"pg_13\",\"english\":[\"My Hero Academia: Heroes Rising\"],\"japanese\":[\"僕のヒーローアカデミア THE MOVIE　ヒーローズ：ライジング\"],\"synonyms\":[\"Моя геройская академия: Восхождение героя\",\"Моя геройская академия: Герои. Восстание\",\"My Hero Academia the Movie 2: Heroes:Rising\"],\"license_name_ru\":null,\"duration\":104,\"description\":\"Класс 1-А из Геройской академии UA отправляется на остров Набу, чтобы помочь местным жителям в их повседневных проблемах. Отличная погода, низкий уровень преступности, гостеприимные жители: эта практика напоминала скорее каникулы, чем серьёзное задание. Однако отдых длился недолго. Взявшаяся будто из ниоткуда злодейская группировка вдруг проявила себя и стала угрожать безопасности мирных жителей. Сможет ли [character=117909]Идзуку Мидория[/character] вместе со своими одноклассниками противостоять злодеям и оправдать звание героя?\",\"description_html\":\"\\u003cdiv class=\\\"b-text_with_paragraphs\\\"\\u003eКласс 1-А из Геройской академии UA отправляется на остров Набу, чтобы помочь местным жителям в их повседневных проблемах. Отличная погода, низкий уровень преступности, гостеприимные жители: эта практика напоминала скорее каникулы, чем серьёзное задание. Однако отдых длился недолго. Взявшаяся будто из ниоткуда злодейская группировка вдруг проявила себя и стала угрожать безопасности мирных жителей. Сможет ли \\u003c